ox-->\n            <input\n                    class=\"admin__control-checkbox\"\n                    type=\"checkbox\"\n                    tabindex=\"-1\"\n                    data-bind=\"attr: { 'checked': $parent.root.isSelected(option.value) }\">\n            <!--/ko-->\n            <label\n                    class=\"admin__action-multiselect-label\"\n                    data-bind=\"text: option.label\">\n            </label>\n        </div>\n        <!-- ko if: $data.optgroup -->\n        <!-- ko template: {name: $parent.root.optgroupTmpl, data: {root: $parent.root, current: $data}} -->\n        <!-- /ko -->\n        <!-- /ko-->\n    </li>\n    <!-- /ko -->\n    <!-- /ko -->\n</ul>\n","Magento_Ui/templates/grid/cells/link.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<div class=\"data-grid-cell-content\"\n     if=\"!$col.isLink($row())\"\n     text=\"$col.getLabel($row())\"/>\n<a   class=\"action-menu-item\"\n     if=\"$col.isLink($row())\"\n     text=\"$col.getLabel($row())\"\n     attr=\"href: $col.getLink($row())\"/>\n","Magento_Ui/templates/grid/cells/multiselect.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<label class=\"data-grid-checkbox-cell-inner\">\n    <input class=\"admin__control-checkbox\" type=\"checkbox\" data-action=\"select-row\"\n        data-bind=\"\n            staticChecked: $col.selected,\n            disable: $col.disabled.indexOf($row()[$col.indexField]) != -1 ,\n            checkedValue: $row()[$col.indexField],\n            attr: {\n                id: index + 'check' + $row()[$col.indexField]\n            }\">\n    <label attr=\"for: index + 'check' + $row()[$col.indexField]\"/>\n</label>\n","Magento_Ui/templates/grid/cells/html.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<div class=\"data-grid-cell-content\" html=\"$col.getLabel($row())\"/>\n","Magento_Ui/templates/grid/cells/thumbnail.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<img class=\"admin__control-thumbnail\" attr=\"src: $col.getSrc($row()), alt: $col.getAlt($row())\"/>\n","Magento_Ui/templates/grid/cells/onoff.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<div class=\"admin__actions-switch\">\n    <input class=\"admin__actions-switch-checkbox\"\n           type=\"checkbox\"\n           data-bind=\"\n               staticChecked: $col.selected,\n               value: $row()[$col.indexField],\n               attr: {\n                   id: 'check' + $row()[$col.indexField]\n               }\">\n    <label class=\"admin__actions-switch-label\"\n           data-bind=\"\n               attr: {\n                   for: 'check' + $row()[$col.indexField]\n               }\">\n        <span data-bind=\"attr: {\n                   'data-text-on': $t('Yes'),\n                   'data-text-off': $t('No')\n              }\"\n              class=\"admin__actions-switch-text\"></span>\n    </label>\n</div>\n","Magento_Ui/templates/grid/cells/expandable.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<div class=\"data-grid-cell-content\">\n    <span text=\"$col.getFullLabel($row())\" ifnot=\"$col.isExpandable($row())\"/>\n\n    <div if=\"$col.isExpandable($row())\">\n        <div text=\"$col.getShortLabel($row())\" class=\"admin__control-short-label\" />\n        <a attr=\"'data-tooltip-trigger': ++ko.uid\" translate=\"'Show more'\"/>\n        <div\n            tooltip=\"\n                tooltipClasses: 'data-grid-column-tooltip',\n                trigger: '[data-tooltip-trigger=' + ko.uid + ']',\n                action: 'click',\n                delay: 0,\n                cente